//função para estruturar o log
function EstruturarLog(sNomeMenu, mensagem){
  //Padroniza o tamanho do nome do menu em X caracteres
  var tamanhoNomeMenu = 25;
  var log = '';
  if (sNomeMenu.length > tamanhoNomeMenu){
    sNomeMenu = sNomeMenu.substring(0,tamanhoNomeMenu);

  }else if (sNomeMenu.length < tamanhoNomeMenu){
    while (sNomeMenu.length < tamanhoNomeMenu){
      sNomeMenu = sNomeMenu + ' ';
    }
  }
  log = '[' + sNomeMenu + '] -' + mensagem;
  return log;

