function trim(stringToTrim) {
  stringToTrim = stringToTrim + '';
  return stringToTrim.replace(/^\s+|\s+$/g,"");
}
function ltrim(stringToTrim) {
  stringToTrim = stringToTrim + '';
  return stringToTrim.replace(/^\s+/,"");
}
function rtrim(stringToTrim) {
  stringToTrim = stringToTrim + '';
  return stringToTrim.replace(/\s+$/,"");
}
function chr(ascii) {  
  return String.fromCharCode(ascii);  
}  

//Armazena o menu da vez...
var mapMenu = {};

//Zera o menu
function zeraMenu() {
  mapMenu.frases = '';
  mapMenu.mascara = 0;
  mapMenu.log = '';
}

//Inclui uma opcao no menu (frase e número da opção)
function incluiOpcaoMenu(opcao, frase) {
  if (trim(frase) != '') {
    if (mapMenu.frases != '') {
      mapMenu.frases += ';';
    }
    mapMenu.frases += frase;
  }
  if (opcao >= 0) {
    mapMenu.mascara += (1 << opcao);
    mapMenu.log += opcao + ' ';
  }
}

//Retorna o tipo de discagem no menu
function tipoRetornoMenu(opcao) {
  var opcTam = opcao.length;
  logger.info('Validando coleta - TAM: ' + opcTam);
  if(opcTam > 0){
    if (opcao == '!') return 'MENU_TIMEOUT';
    if (mapMenu.mascara & (1 << opcao))
    return 'MENU_OPCAO_OK';
    else
    return 'MENU_OPCAO_NOK';
  }else
    return 'MENU_TIMEOUT';  
}
