//////
// FUNÇÃO DE ORDENAÇÃO DE PERGUNTAS
//////
function ordenaPerguntas(qntPerguntas) {
  var qntP = 0;
  var count = 0;
  var x = Math.floor((Math.random() * 10) + 1);
  var y = 0;
  var ordem = [];

  qntP = qntPerguntas;
  // A Contagem é iniciada do zero (0)
  while (count < qntP){
    x = Math.floor((Math.random() * 10) + 1); //Random não inclui zero (0) na contagem
    if (x < qntP+1){       
      y = ordem.indexOf(x);
      if(y != -1){ //Valida se Ja Existe o Núumero Dentro da Lista de Perguntas
        y= -1;
      }else{
        ordem.push(x);
        count += 1;
      }
    }
  }
  return ordem;
}


//////
// CALCULAR DURACAO
//////
function CalcDuracao(inicio,fim){

  // Função foi segmentada com uma validação de

  var auxDtInicio =inicio.substr(0,8);
  var auxDtFim=fim.substr(0,8);
  var auxHrInicio=inicio.substr(8,6);
  var auxHrFim=fim.substr(8,6);
  var auxDuracao = '';


  logar('INICIO-ROTINAS-APP','Data inicio: '+auxDtInicio);
  logar('INICIO-ROTINAS-APP','Data fim   : ' + auxDtFim);
  logar('INICIO-ROTINAS-APP','Hora inicio: ' + auxHrInicio);
  logar('INICIO-ROTINAS-APP','Hora fim   : ' + auxHrFim);
  logar('INICIO-ROTINAS-APP','Calculando Tempo em segundos --');
  //logger.info("Data inicio: " + auxDtInicio);
  //logger.info("Data fim   : " + auxDtFim);
  //logger.info("Hora inicio: " + auxHrInicio);
  //logger.info("Hora fim   : " + auxHrFim);
  //logger.info('Calculando Tempo em segundos --');

  auxDuracao = DNKBiblioteca.dthrDif(inicio, fim, 'yyyyMMddhhmmss', 's');

  try{
    if(auxDtInicio < auxDtFim){
      logar('INICIO-ROTINAS-APP','Ligação iniciou em dia anterior');
      //logger.info('Ligação iniciou em dia anterior');

      if(auxDuracao > 43200 && auxDuracao < 86400){
        logar('INICIO-ROTINAS-APP','Horario da máquina deve estar em AM/PM');
        //logger.info('Horario da máquina deve estar em AM/PM');
        auxDuracao -= 43200;
      }
      else if(auxDuracao > 86400){
        logar('INICIO-ROTINAS-APP','Horario da máquina deve estar em 24h');
        //logger.info('Horario da máquina deve estar em 24h');
        auxDuracao -= 86400;
      }
      else{
        logar('INICIO-ROTINAS-APP','Situação inesperada - NÃO DEVIA TER VINDO PRO ELSE');
        //logger.info('Situação inesperada - NÃO DEVIA TER VINDO PRO ELSE');

      }
    }
    else{
      logar('INICIO-ROTINAS-APP','Como a ligação começou e temrinou no mesmo dia');
      logar('INICIO-ROTINAS-APP','Mas os valores conferem?');
      logar('INICIO-ROTINAS-APP','vamos fazer o cálculo normal');
      //logger.info('Como a ligação começou e temrinou no mesmo dia');
      //logger.info('Mas os valores conferem?');
      //logger.info('vamos fazer o cálculo normal');

      if(auxDuracao > 43200 && auxDuracao < 86400){
        logar('INICIO-ROTINAS-APP','Horario da máquina deve estar em AM/PM');
        //logger.info('Horario da máquina deve estar em AM/PM');
        auxDuracao -= 43200;
      }
      else if(auxDuracao > 86400){
        logar('INICIO-ROTINAS-APP','Horario da máquina deve estar em 24h');
        auxDuracao -= 86400;
      }
    }

    logar('INICIO-ROTINAS-APP','A Duração encontrada foi: ' + auxDuracao)
      return auxDuracao;
  }catch(err){
    logar('INICIO-ROTINAS-APP','Ocorreu erro na validação da duração.');
    logar('INICIO-ROTINAS-APP','Calcular duração para as datas à baixo');
    logar('INICIO-ROTINAS-APP','Inicio: ' + inicio);
    logar('INICIO-ROTINAS-APP','Fim: '+ fim);

    logar('INICIO-ROTINAS-APP','Duração encontrada: ' + auxDuracao);

    return auxDuracao;
  }
}

