  }
  if(aplPidAcao == 'TROCA'){
    logar('INICIO-ROTINAS-APP','Marcando CVV, Dt.Nasc. e Senha como coletados');
    aplPidNasc = true;
    aplPidCVV = true;
    aplPidSen = true;
    aplPerg1 = true;
    aplPerg2 = true;
    aplPerg3 = true;

  }
  if(aplPidAcao == '2VIA'){
    logar('INICIO-ROTINAS-APP','Marcando Dt.Nasc. e Senha como coletados');
    aplPidNasc = true;
    aplPidSen = true;
    aplPerg2 = true;
    aplPerg4 = true;
  }
  if(aplPidAcao == 'DESBLOQUEIO'){
    logar('INICIO-ROTINAS-APP','Marcando Dt.Nasc, Dt.Validade e Senha como coletados');
    aplPidVal = true;
    aplPidSen = true;
    aplPidNasc = true;
    aplPerg2 = true;
    aplPerg3 = true;
    aplPerg4 = true;
  }
}


