//Validação da mensagem informativa.
//
//REGRA:
// PEGA DIA E HORA  DA PARA VALIDAR
// A CONFIGURACAO DA VARIÁVEL MSG_INFORMATIVA_PAYPAXX É FEITA DA SENGUINTE FORMA
// ddMM:HHmm-HHmm
//
// AO PEGAR A POSICAO, CAPTURAMOS A HORA INICIO E A HORA FIM PARA VERIFICAR SE A LIGACAO
// ESTA DENTRO DO RANGE DA MENSAGEM.
// SE ESTIVER: TOCA O AUDIO MSG_INFORMATIVA
// SE NAO ESTIVER: TOCA SILENCIO

aplFrases = 'SILENCIO';

logar('TocaInformativo','-TocaInformativo-');

diaHoje = DNKBiblioteca.dthrPega('ddMM');
horaHoje = DNKBiblioteca.dthrPega('HHmm');

aplDataMsg = String(MSG_INFORMATIVA_PAYPAXX).indexOf(diaHoje);
logar('TocaInformativo','Validando msg informativa, dia: ' + diaHoje + ' e hora: ' + horaHoje);
if(aplDataMsg >= 0){
  posParcial = String(MSG_ESPECIAL).indexOf(diahoje) + 5;
  aplHrMsgIni = String(MSG_INFORMATIVA_PAYPAXX).substr(posParcial,4);
  aplHrMsgFim = String(MSG_INFORMATIVA_PAYPAXX).substr(posParcial+5,4);

  logar('TocaInformativo','RANGE DE HORARIO - INICIO: ' + aplHrMsgIni + ' / FIM: ' + aplHrMsgFim);
  logar('TocaInformativo','MENSGAEM INFORMATIVA INDENTIFICADA');
  if(horaHoje >= aplHrMsgIni && horaHoje <= aplHrMsgFim) aplFrases = 'MSG_INFORMATIVA';
  logar('TocaInformativo','TOCANDO: ' + aplFrases);
  aplDadosLog += ';Tocando msg Informativa';
}else{
  logar('TocaInformativo','SEM MENSAGEM INFORMATIVA A SER TOCADA');
  aplDadosLog += ';Sem msg Informativa';
  aplFrases = 'SILENCIO';
}

